import { store } from './redux/store';
import './App.css';
import Cover from './Container/Cover/Cover';
import { Provider } from 'react-redux';


function App() {

  return (
    <Provider store={store}>
      <div className="App">
      <Cover />
      </div>
    </Provider>

  );
}

export default App;
